import logo from './logo.svg';
import './App.css';
import {BrowserRouter, Route} from "react-router-dom";
import Home from "./pages/home";

function App() {
  return (
      <BrowserRouter>
        <Route path="/" element={<Home />} />
        <Route path="/home" element={<Home />} />
      </BrowserRouter>
  );
}

export default App;
